import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  debugger
  constructor(props) {
    super(props); 
    this.state = {};
  }

  componentDidMount() {

    fetch("/api/greeting")
      .then(res => res.text())
      .then(res => console.log(res))
      .then(greetings => this.setState({
        greetings: greetings
      }));
    }

  render() {
    // console.log(this.state)
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {this.state.greeting ? 
            this.state.greetings.map((greeting, id) =>
            <div key={id}>{greeting.status}</div>) : null }
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
